import React, { Component } from 'react';
import { Text, View, Image, TouchableOpacity } from "react-native";
import {IMAGE} from './constants/image'


export class CustomHeader extends Component {
    render() {
        let { navigation, isHome, title } = this.props;

        return (
            <View style={{flexDirection: "row",height: 50,backgroundColor:'#39D5D5'}}>
                <View style={{flex:1, justifyContent:'center'}}>
                { 
                isHome ?
                    <TouchableOpacity onPress={()=> navigation.openDrawer()}>
                    <Image style={{width:30 ,height:30, marginLeft:5}}

                    resizeMode="contain"
                    />
                    </TouchableOpacity>
                : 
                <TouchableOpacity style={{flexDirection:'row', alignItems:"center"}}
                onPress={() => navigation.goBack()}>
                    <Image style={{width:25 ,height:25,marginLeft:20}}  
                    source = {IMAGE.ICON_BACK}
                    resizeMode="contain"
                    />
                    {/* <Text style={{color:'white', fontWeight:'bold',fontSize:15}}> Back</Text> */}
                </TouchableOpacity>
                }
                </View>
                <View style={{flex:1.5, justifyContent:'center'}}>
                    <Text style={{textAlign:'center', fontWeight:'bold', color:'white', fontSize:16}}>{title}</Text>
                </View>
                <View style={{flex:1}}></View>
            </View>
          );
    }
}
